import React from 'react';
var images = require.context('../../assets/images', true);

class ImageD extends React.Component {

    render() {
        const image_path = this.props.imagePath
        let img_src = images(image_path)
        return (
            <img src={img_src} alt=""/>
        );
    }
}

export default ImageD;
